import React, { useEffect, useState } from 'react'

export default function AllEmpoyee() {

    const [data ,setdata] = useState([]);

    useEffect(()=>{
        fetch("http://localhost:9000/getall").
        then((res)=>res.json())
        .then((val)=>{
            setdata(val);
        })
        .catch((err)=>console.log("unable to fetch",err))
        
    })
  return (
    <div>
      <table class="table">
  <thead>
    <tr>
      <th scope="col">Id</th>
      <th scope="col">name</th>
      <th scope="col">email</th>
      <th scope="col">mobile</th>
      <th scope="col">joining data</th>
      <th scope="col">salary</th>
     
    </tr>
  </thead>
  <tbody>
    {
        data && data.length>0 && data.map((val)=>{
            return(
            <tr>
              <th scope="row">1</th>
             <td>{val.id}</td>
             <td>{val.name}</td>
             <td>{val.email}</td>
             <td>{val.mobileno}</td>
             <td>{val.joiningdate}</td>
             <td>{val.salary}</td>  
             </tr>
            )
        })
    }
    
    
  </tbody>
</table>
    </div>
  )
}
